A works in the exciting, innovative and ever-changing changing landscape of digital media which demands flexible and problem-solving skills from those working on our teams.\r\n\r\nAs a company, our R&D ethos also ensures that as well as servicing our clients needs today, we are also anticipating the future and looking at new production and delivery methods and services for the learning materials, interactives, video, web and communication services which we develop and provide every day.','','2009-05-29','2009-05-27 13:52:12','2009-05-27 13:53:06',NULL,NULL,86,87,55,1,1,56,NULL),(64,'Senior Project Manager','Senior PM - Wellington - Contract\r\n\r\nLooking for a large project to sink your teeth into? Looking for good contracting $$$ in a tight market place?\r\n\r\nIf so Apply Now!!!\r\n\r\n	Software Development / Billing \r\n	Prince 2 / PMP \r\n	IT / Telecommunications\r\n\r\n\r\nYou will have extensive experience in managing large projects in the telecommunications environment dealing with either software development work or large billing systems. \r\n\r\nYou will need to have good technical knowledge of the environment you are managing, have excellent stakeholder management and vendor management skills and you will have a strong focus on project delivery.\r\n\r\nThis is an opportunity to get involved in big projects where your skill level will be matched with competitive remuneration.','',NULL,'2009-05-27 13:54:14','2009-05-27 13:54:36',NULL,NULL,88,89,57,3,3,58,NULL),(65,'Production Engineering Manager','n/a','',NULL,'2009-05-27 13:58:30','2009-05-27 13:58:30',NULL,NULL,92,93,61,1,1,62,NULL),(66,'Male Chaperone','n/a','',NULL,'2009-05-27 14:00:40','2009-05-27 14:02:06',30,NULL,94,95,63,1,5,64,NULL),(67,'Application Development Manager','The Datamail Group of Companies is a proven leader in Business Information Services, as well as being New Zealand\'s largest and most advanced integrated data and document management service provider. We operate across a wide range of private and public blue-chip organisations throughout Australasia. \r\n\r\nThe Application Development Manager role has two primary focuses  firstly to lead and manage our archive application team in Wellington. The second focus of this role is to plan, coordinate, and supervise all activities relating to the design, development and implementation of the archive application. ','','2009-06-02','2009-05-27 14:03:51','2009-05-27 14:03:51',NULL,NULL,96,97,65,1,1,66,NULL),(68,'Development Team Leader - Document Management','n/a','',NULL,'2009-05-27 14:05:34','2009-05-27 14:05:34',NULL,NULL,100,101,69,1,1,70,NULL),(69,'Project Manager [Auckland]','n/a','',NULL,'2009-05-27 14:07:02','2009-05-27 14:07:02',NULL,NULL,104,105,73,1,1,74,NULL),(70,'Project Manager - Web Projects','Project Manager needed for web site project delivery. They need a web professional to manage and advise on the delivery of projects to develop websites and web-based resources. (These may be for teachers, students, families, communities, or adult learners in NZ or our international markets.) ','DM65205',NULL,'2009-05-27 14:11:22','2009-05-27 14:11:22',65000,75000,108,109,77,1,1,78,NULL),(71,'Project Managers','n/a','LMAME03',NULL,'2009-05-27 14:13:29','2009-05-27 14:13:29',NULL,NULL,110,111,79,1,1,80,NULL),(72,'Manager [non-for-profit organisation]','n/a','',NULL,'2009-05-27 14:14:55','2009-05-27 14:14:55',NULL,NULL,112,113,81,1,1,82,NULL),(73,'Project Manager','n/a','','2009-05-15','2009-05-27 14:19:04','2009-05-27 14:19:04',NULL,NULL,114,115,83,1,1,84,NULL),(74,'test','test','',NULL,'2009-05-29 14:03:08','2009-05-29 14:03:08',NULL,NULL,116,117,110,1,1,111,NULL),(75,'test','<p>&nbsp;<span class=\"Apple-style-span\" style=\"color: rgb(26, 26, 26); \"><img src=\"http://www.seek.co.nz/templates/24541302_1_logo.gif\" alt=\"logo\" style=\"border-top-width: 0px; border-right-width: 0px; border-bottom-width: 0px; border-left-width: 0px; border-style: initial; border-color: initial; outline-width: 0px; ou