x; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; \">This Wellington-based company has been developing websites and web applications for nearly a decade.&nbsp;&nbsp; Over this time they have become a well-respected name in the market and are now known for their ability to provide innovative, robust web solutions via best of breed technologies, and for their rigorous approach to client retention.&nbsp;</div>\r\n<div style=\"border-top-width: 0px; border-right-width: 0px; border-bottom-width: 0px; border-left-width: 0px; border-style: initial; border-color: initial; outline-width: 0px; outline-style: initial; outline-color: initial; margin-top: 0px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; \">&nbsp;</div>\r\n<div style=\"border-top-width: 0px; border-right-width: 0px; border-bottom-width: 0px; border-left-width: 0px; border-style: initial; border-color: initial; outline-width: 0px; outline-style: initial; outline-color: initial; margin-top: 0px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; \">They have a pipeline of work pending, and may need additional resource in order to deliver.&nbsp; They are now interested in hearing from those with the skills, experience and flexibility to meet those pending needs.&nbsp; Please be aware these opportunities are yet to be confirmed so timeframe is still to be defined.</div>\r\n<div style=\"border-top-width: 0px; border-right-width: 0px; border-bottom-width: 0px; border-left-width: 0px; border-style: initial; border-color: initial; outline-width: 0px; outline-style: initial; outline-color: initial; margin-top: 0px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; \">&nbsp;</div>\r\n<div style=\"border-top-width: 0px; border-right-width