ing-left: 0px; \"><strong style=\"border-top-width: 0px; border-right-width: 0px; border-bottom-width: 0px; border-left-width: 0px; border-style: initial; border-color: initial; outline-width: 0px; outline-style: initial; outline-color: initial; margin-top: 0px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; \"><em>* Liaise with clients at all stages of a project from the initial concept phase through to implementation and post production maintenance requirements</em></strong></div>\r\n<div style=\"border-top-width: 0px; border-right-width: 0px; border-bottom-width: 0px; border-left-width: 0px; border-style: initial; border-color: initial; outline-width: 0px; outline-style: initial; outline-color: initial; margin-top: 0px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; \">&nbsp;</div>\r\n<div style=\"border-top-width: 0px; border-right-width: 0px; border-bottom-width: 0px; border-left-width: 0px; border-style: initial; border-color: initial; outline-width: 0px; outline-style: initial; outline-color: initial; margin-top: 0px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; \"><strong style=\"border-top-width: 0px; border-right-width: 0px; border-bottom-width: 0px; border-left-width: 0px; border-style: initial; border-color: initial; outline-width: 0px; outline-style: initial; outline-color: initial; margin-top: 0px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; \"><em>* Manage multimedia content, taking responsibility for sourcing, scheduling, evaluating, editing and assuring the quality of materials submitted for inclusion online</em></strong><b><i><br />\r\n</i></b></div>\r\n<div style=\"border-top-width: 0px; border-right-width: 0px; border-bottom-width: 0px; border-left-width: 0px; border-style: initial; border-color: initial; outline-width: 0px; outline-style: initial; outline-color: initial; margin-top: 0px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; \">&nbsp;</div>\r\n<p>&nbsp;</p>','100374',NULL,'2009-09-22 11:06:57','2009-11-02 23:56:03',75,85,196,197,194,1,1,195,NULL),(82,'Senior Project Manager','<p><font class=\"Apple-style-span\" color=\"#FFFFFF\" face=\"Arial, Helvetica, sans-serif\" size=\"3\"><span class=\"Apple-style-span\" style=\"font-size: 13px;\"><span class=\"Apple-style-span\" style=\"color: rgb(26, 26, 26); font-size: 12px; \"> </span></span></font></p>\r\n<p><font class=\"Apple-style-span\" color=\"#FFFFFF\" face=\"Arial, Helvetica, sans-serif\" size=\"3\">\r\n<div class=\"templogo\" style=\"border-top-width: 0px; border-right-width: 0px; border-bottom-width: 0px; border-left-width: 0px; border-style: initial; border-color: initial; outline-width: 0px; outline-style: initial; outline-color: initial; margin-top: 0px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding-top: 20px; padding-right: 20px; padding-bottom: 20px; padding-left: 20px; text-align: right; \"><img width=\"209\" height=\"55\" style=\"border-top-width: 0px; border-right-width: 0px; border-bottom-width: 0px; border-left-width: 0px; border-style: initial; border-color: initial; outline-width: 0px; outline-style: initial; outline-color: initial; margin-top: 0px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; \" alt=\"\" src=\"http://www.seek.co.nz/templates/3543024_4_header.gif\" /></div>\r\n<div class=\"tempheader\" style=\"border-top-width: 0px; border-right-width: 0px; border-bottom-width: 0px; border-left-width: 0px; border-style: initial; border-color: initial; outline-width: 0px; outline-style: init