le-position: outside; list-style-type: disc; \">Hold a Tertiary degree</li>\r\n    <li style=\"border-top-width: 0px; border-right-width: 0px; border-bottom-width: 0px; border-left-width: 0px; border-style: initial; border-color: initial; outline-width: 0px; outline-style: initial; outline-color: initial; margin-top: 0px; margin-right: 0px; margin-bottom: 0px; margin-left: 14px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; list-style-position: outside; list-style-type: disc; \">3-5 years solid PM experience</li>\r\n</ul>\r\nJoin this highly successful team now - they are fun, dedicated to their field of expertise and seeking similar minded individuals.&nbsp;<br />\r\nSalary up to $120,000.&nbsp;<br />\r\n<br />\r\n<br />\r\nFor further information, please call Maree Hayes at absoluteIT on 04 499 7848 or 0800 29 89 99, or apply directly right now by clicking below.<br />\r\n<br />\r\nNOTE for Overseas Enquiries and Non NZ Residents:<br />\r\nWhereas we welcome international enquiries, only applicants that are legally entitled to work in New Zealand and can make themselves available for interviews in New Zealand will be considered for advertised positions.<br />\r\nOthers may not necessarily be responded to.</div>\r\n<div class=\"details\" style=\"border-top-width: 0px; border-right-width: 0px; border-bottom-width: 0px; border-left-width: 0px; border-style: initial; border-color: initial; outline-width: 0px; outline-style: initial; outline-color: initial; margin-top: 0px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding-top: 20px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; color: rgb(255, 255, 255); font-size: 8pt; font-weight: bold; text-align: left; \"><br />\r\nEmail: Please click the \'Apply Now\' button below.</div>\r\n</div>\r\n<div class=\"tempfooter\" style=\"border-top-width: 0px; border-right-width: 0px; border-bottom-width: 0px; border-left-width: 0px; border-style: initial; border-color: ini