 0px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; \">You will have a background which includes experience as a Senior Project Manager, working for either a software vendor or a consulting firm, where you have gained a sound commercial focus.</li>\r\n    <li style=\"border-top-width: 0px; border-right-width: 0px; border-bottom-width: 0px; border-left-width: 0px; border-style: initial; border-color: initial; outline-width: 0px; outline-style: initial; outline-color: initial; margin-top: 0px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; \">As a Senior Project Manager you will be working on chargeable activities up to 80% of the time and will be required to be flexible to be able to travel to client sites as directed by the manager up to 80% of their time.</li>\r\n</ul>\r\n</b></b></blockquote>\r\n<p>&nbsp;</p>\r\n</div>\r\n</span></p>','',NULL,'2009-11-02 23:07:38','2009-11-02 23:52:49',NULL,NULL,NULL,379,NULL,1,1,369,NULL),(98,'Project Manager','<p>&nbsp;Project Management @ OnTrack</p>','',NULL,'2009-11-03 03:23:18','2009-11-03 03:35:30',NULL,NULL,368,380,363,1,1,370,NULL),(99,'Test role','<p>&nbsp;Test Role</p>','',NULL,'2009-11-03 09:05:31','2009-11-03 09:05:41',NULL,NULL,369,NULL,371,2,4,NULL,NULL),(100,'test role','<p>&nbsp;<strong>tetewrtewrtfgdfgdfg fgfdgdf gdfg dfg</strong></p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"background-color: lime; \">dfgsdf fgdfgdf</span></p>','','2009-11-20','2009-11-03 09:10:10','2009-11-03 09:10:10',NULL,NULL,NULL,NULL,NULL,NULL,5,NULL,NULL),(101,'test role','<p>&nbsp;teste</p>','',NULL,'2009-11-04 08:14:28','2009-11-04 08:14:36',NULL,NULL,198,NULL,372,NULL,4,NULL,NULL);
